function PatternCard() {
  return (
    <>
      <div className="max-w-md rounded overflow-hidden shadow-lg">
        <div className="px-6 py-4">
          <div className="font-bold text-xl mb-2">Intestazione</div>
          <p className="text-gray-700 text-base">
            Descrizione della card. Puoi aggiungere qui qualsiasi testo o
            contenuto che desideri visualizzare.
          </p>
        </div>
      </div>
    </>
  );
}

export default PatternCard;
